import React from "react";
import Skill from "./Skill.js";
export default class extends React.Component{
    render(){
        state={
            titles:{
                webDev:{
                    title:"Web Development",
                    skills:["React","SCSS"],
                },
                personal:{
                    title:"Personal",
                    skills:"Loving Jaymee",
                }
            }
        }
        return(
            <Skill/>
        );
    }
}
